package ClubberLogic;

public class UserReviews {
	private int userEmail;
	private int availability;
	private int realiability;
	private int treats;
	private int punctuality;
	private int general;
	
	public UserReviews() {
		// TODO Auto-generated constructor stub
	}
	
	public int getAvailability() {
		return availability;
	}
	public void setAvailability(int availability) {
		this.availability = availability;
	}
	public int getRealiability() {
		return realiability;
	}
	public void setRealiability(int realiability) {
		this.realiability = realiability;
	}
	public int getTreats() {
		return treats;
	}
	public void setTreats(int treats) {
		this.treats = treats;
	}
	public int getGeneral() {
		return general;
	}
	public void setGeneral(int general) {
		this.general = general;
	}

	public int getUserEmail() {
		return userEmail;
	}

	public void setUserEmail(int userEmail) {
		this.userEmail = userEmail;
	}

	public int getPunctuality() {
		return punctuality;
	}

	public void setPunctuality(int punctuality) {
		this.punctuality = punctuality;
	}
	
	
}
